// src/components/EndPage.js
import React from 'react';

function EndPage() {
  return (
    <div className="container end-page">
      <h1>퀴즈를 완료하셨습니다!</h1>
      <p>참여해 주셔서 감사합니다.</p>
    </div>
  );
}

export default EndPage;
